<!doctype html>
<html lang="en-us">

<head>
  <meta charset="utf-8">
  <meta http-equiv="Content-Type" content="text/html; charset=utf-8">
  <title>Emscripten-Generated Code</title>
</head>

<body>
  <script>
    (async function () {
      let result = await fetch('./index.wasm')
      result = await result.arrayBuffer()
      let wasm = await WebAssembly.instantiate(result)
      wasm.instance.exports.main()
    })()
  </script>
  <script src="index.wasabi.js"></script>
  <script src="log-all.js"></script>
</body>

</html>
